            var controlCheckBox = document.createElement("input");
            controlCheckBox.value = type;

            controlCheckBox.checked = false;
            controlCheckBox.style.margin = "0px 5px 0px 5px";
            controlCheckBox.style.verticalAlign = "middle";

            controlCheckBox.addEventListener("click", function () {
                markersShowHide(this.value, this.checked);
            });
